import React from 'react';
import './Footer.css';
import img1 from '../../images/facebook.png';
import img2 from '../../images/twitter.png';
import img3 from '../../images/linkedin.png';
import img4 from '../../images/instagram.png';
export default function Footer(){

    return(
        <>
        <div className="panel f">
            <div className="f-title">
                <h1>Only Thing Which always pushes you UP is your Everyday Learning !</h1>
                <h3>You Can Also Contact me on Social Media</h3>
            </div>
            <div className="f-media">
                <img src={img1} alt="" />
                <img src={img2} alt="" />
                <img src={img3} alt="" />
                <img src={img4} alt="" />
            </div>
            <h2 className="cright">
                <h1>&copy; : Portfolio</h1>
            </h2>
        </div>
        </>
    )

}
